import { Typography, Box} from "@material-ui/core";
import { SectionContainer } from "../../StyledComponents";

interface Props {

}



export const PriceSection: React.FC<Props> = () => {

    const offerOne = {
        price: 129,
        durationMonth: 6,
        features: [
            "Über 100 Unterkünfte jederzeit nutzen",
            "Familie & Freunde kostenlos mitnehmen",
            "Vor Ort: Fahrräder, BBQ, Liegestühle, etc.",
            "Tour-Guide für Ausflüge und Aktivitäten",
            "24/7 Vor-Ort-Service bei Problemen"
        ]
    }

    const offerTwo = {
        price: 129,
        durationMonth: 6,
        features: [
            "Über 100 Unterkünfte jederzeit nutzen",
            "Familie & Freunde kostenlos mitnehmen",
            "Vor Ort: Fahrräder, BBQ, Liegestühle, etc.",
            "Tour-Guide für Ausflüge und Aktivitäten",
            "24/7 Vor-Ort-Service bei Problemen"
        ]
    }


   return (

    <SectionContainer>
        <Box>
            <Typography variant="h6">
               PriceSection
           </Typography>
        </Box>

    </SectionContainer>
   )
}
